    l = [0] * (n + 1)
    r = [0] * (n + 1)
    l[1] = 1
    r[n] = n
    for i in range(2, n + 1):
        if a[i - 1] == a[i]:
            l[i] = l[i - 1]
        else:
            l[i] = i
        if a[n - i + 1] == a[n - i + 2]:
            r[n - i + 1] = r[n - i + 2]
        else:
            r[n - i + 1] = n - i + 1

    def win1():
        if n == k or r[k + 1] == n or l[n - k] == 1:
            return True
        for i in range(2, n - k + 1):
            if l[i - 1] == 1 and r[i + k] == n and (a[i - 1] == a[i + k]):
                return True
        return False

    def win2():
        if 2 * k < n:
            return False
        for i in range(1, n - k + 1):
            if l[i - 1] != 1 or r[i + k] != n:
                return False
        return True
    if win1():
        return 'tokitsukaze'
    elif win2():
        return 'quailty'
    else:
        return 'once again'

